import React from "react";
import Card from "./Card";

function CardExpenses(props) {
    const expenses = [
        {
          id: "e1",
          title: "Paper",
          amount: 94.12,
          date: new Date(2020, 7, 14),
        },
        {
          id: "e2",
          title: "New TV",
          amount: 799.49,
          date: new Date(2021, 2, 12),
        },
        {
          id: "e3",
          title: "Car Insurance",
          amount: 294.67,
          date: new Date(2021, 2, 28),
        },
        {
          id: "e4",
          title: "New Desk (Wooden)",
          amount: 450,
          date: new Date(2021, 5, 12),
        },
        {
          id: "e4",
          title: "New Card",
          amount: 333,
          date: new Date(2021, 5, 12),
        },
    ];
return (
    <div>
<Card
    date= {props.card[0].date}
    name= {props.card[0].title}
    cost= {props.card[0].amount}
/>
<Card
    date= {props.expenses[4].date}
    name= {props.expenses[4].title}
    cost= {props.expenses[4].amount}
/>
</div>
);
}

export default CardExpenses;
